import React from "react";
import bankLogo from '../bank.png';
const NavBar=()=>{
    return(
        <nav class="navbar navbar-expand-lg navbar-dark bg-dark static-top">
        <div class="container">
          <a class="navbar-brand" href="#">
            <img src={bankLogo} alt="..." height="36"/>
          </a>
         
        </div>
      </nav>
    );
}
export default NavBar;
